import React from 'react';

function Property() {
  // JavaScript to handle checkbox change event
  const handleCheckboxChange = (checkboxId) => {
    var checkbox = document.getElementById(checkboxId);
    console.log(`Checkbox ${checkboxId} is ${checkbox.checked ? 'checked' : 'unchecked'}`);
  };

  return (
    <div className=''>
      <h4>Current Market Value : <input type='text' /></h4>
      <h4>Land Square feet  : <input type='text' /></h4>
      <h4>ZIP/PIN code : <input type='text' /></h4>
      <h4>Building age  : <input type='text' /></h4>
      <h4>Past records : <input type='text' /></h4>

      {/* Checkboxes */}
      <div>
        <label>
          <input type="checkbox" id="checkbox1" onChange={() => handleCheckboxChange('checkbox1')} />
          Checkbox 1
        </label>
      </div>

      <div>
        <label>
          <input type="checkbox" id="checkbox2" onChange={() => handleCheckboxChange('checkbox2')} />
          Checkbox 2
        </label>
      </div>

      <div>
        <label>
          <input type="checkbox" id="checkbox3" onChange={() => handleCheckboxChange('checkbox3')} />
          Checkbox 3
        </label>
      </div>
    </div>
  );
}

export default Property;
